import Lodgment from '../../components/Lodgement';


const Logement = () => {

    const {logementId} = useParams();
    const navigate = useNavigate();
    const logement = logements.find(el => el.id === logementId);    

    useEffect(() => {

        if (logement === undefined) {
        navigate("*");
        } else {
            {Lodgment(logement)}
        }

    })    


}


export default Logement
